private static FieldFrame getObjectFrame(FieldFrame frame) {
    FieldFrame objectFrame = frame;
    while (objectFrame != null && !objectFrame.isClassOrEnumOrEnumConstDef()) {
        objectFrame = objectFrame.getParent();
    }
    return objectFrame;
}
